asino. Dispatch said the cameras caught him driving 81 MPH. Pulled over near Four Dragons Casino.\n','Z.Smith.00'),(8,'Aisao_Tsukara','21:28','25/5/2009','Zavier Smith',1,0,0,'$100','x minutes','$xx.xx','Include details of all illegal items here...','Speeding in a sentinel without licenses. Pulled him over near Steakhouse.\n','Z.Smith.00');

